@Component({
  selector: 'app-root',
  template: `
    <h1 style="color: red; padding: 20px;">Angular Works!</h1>
    <nav style="background: blue; color: white; padding: 10px;">
      <h2>Simple Navbar Test</h2>
    </nav>
  `,
  standalone: true
})
export class App { }
